import Foundation
import XCTest

@testable import SystemStrings

// MARK: - AudioToolbox Tests

@available(iOS 9.0, *)
final class AudioToolboxStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜AudioToolbox.preferredLocalization = nil
    }

