        XCTAssertEqual(String.％＠_（％gm，_％gm，_％gm）｜AudioToolbox, "\u{25}\u{40}\u{20}\u{28}\u{25}\u{67}\u{6D}\u{2C}\u{20}\u{25}\u{67}\u{6D}\u{2C}\u{20}\u{25}\u{67}\u{6D}\u{29}")
